import islpy as isl
import V3.Quast as Q
from V3.Experiments.timer import Timer
import sys


def get_set(t, set_str, set_name=""):
    print("entering get_set()")
    print("constructing set: " + set_name)
    t.start()
    set_ = isl.Set(set_str)
    t.stop()
    print("exiting get_set()")
    print("--------------------------")
    return set_


def get_quast(t, set_, set_name=""):
    print("entering get_quast()")
    print("constructing quast for set: " + set_name)
    t.start()
    quast = Q.Quast(set_)
    t.stop()
    print("exiting get_quast()")
    print("--------------------------")
    return quast


def subtract_sets(t, A, B, name_A="", name_B=""):
    print("entering subtract_sets()")
    print("Subtracting sets: " + name_A + ", " + name_B)
    t.start()
    C = A.subtract(B)
    t.stop()
    print("exiting subtract_sets()")
    print("--------------------------")
    return C


